import base64

"""
Usage:
from LcfcGetRawFileLib import lcfc_get_raw_file

with open('tmp.png', 'wb') as tmp:
    tmp.write(lcfc_get_raw_file(1))

1 = LCFC.ico file, for tkinter logo
2 = LcfcExcelCollector.py Script.xlsx file
3 = LcfcExcelFilter.py Script.xlsx file
4 = LcfcMailer.py MailList.xlsx file
"""


def lcfc_get_raw_file(file_id):
    if file_id == 1:
        return base64.b64decode(b'\
        \
        \
        \
        \
        \
        \
        \
        \
        \
        \
        \
        '
                                )

    if file_id == 2:
        return base64.b64decode(b'\
        '
                                )

    if file_id == 3:
        return base64.b64decode(b''
                                )

    if file_id == 4:
        return base64.b64decode(b''
                                )

    return None


