    INPUT_FILE_NAME = r"C:\Users\Sea\Desktop\HR\LcfcMailer\MailList.xlsx"
    file = open(INPUT_FILE_NAME, "rb")
    content = file.read()
    b64str = base64.b64encode(content)
    file.close()
    print(content)
